import React from 'react';
import DayWiseProfit from './screens/Reports/DayWiseProfit';

const Toaster = React.lazy(() => import('./views/notifications/toaster/Toaster'));
const Tables = React.lazy(() => import('./views/base/tables/Tables'));

const Breadcrumbs = React.lazy(() => import('./views/base/breadcrumbs/Breadcrumbs'));
const Cards = React.lazy(() => import('./views/base/cards/Cards'));
const Carousels = React.lazy(() => import('./views/base/carousels/Carousels'));
const Collapses = React.lazy(() => import('./views/base/collapses/Collapses'));
const BasicForms = React.lazy(() => import('./views/base/forms/BasicForms'));

const Jumbotrons = React.lazy(() => import('./views/base/jumbotrons/Jumbotrons'));
const ListGroups = React.lazy(() => import('./views/base/list-groups/ListGroups'));
const Navbars = React.lazy(() => import('./views/base/navbars/Navbars'));
const Navs = React.lazy(() => import('./views/base/navs/Navs'));
const Paginations = React.lazy(() => import('./views/base/paginations/Pagnations'));
const Popovers = React.lazy(() => import('./views/base/popovers/Popovers'));
const ProgressBar = React.lazy(() => import('./views/base/progress-bar/ProgressBar'));
const Switches = React.lazy(() => import('./views/base/switches/Switches'));

const Tabs = React.lazy(() => import('./views/base/tabs/Tabs'));
const Tooltips = React.lazy(() => import('./views/base/tooltips/Tooltips'));
const BrandButtons = React.lazy(() => import('./views/buttons/brand-buttons/BrandButtons'));
const ButtonDropdowns = React.lazy(() => import('./views/buttons/button-dropdowns/ButtonDropdowns'));
const ButtonGroups = React.lazy(() => import('./views/buttons/button-groups/ButtonGroups'));
const Buttons = React.lazy(() => import('./views/buttons/buttons/Buttons'));
const Charts = React.lazy(() => import('./views/charts/Charts'));
const Dashboard = React.lazy(() => import('./views/dashboard/Dashboard'));
const CoreUIIcons = React.lazy(() => import('./views/icons/coreui-icons/CoreUIIcons'));
const Flags = React.lazy(() => import('./views/icons/flags/Flags'));
const Brands = React.lazy(() => import('./views/icons/brands/Brands'));
const Alerts = React.lazy(() => import('./views/notifications/alerts/Alerts'));
const Badges = React.lazy(() => import('./views/notifications/badges/Badges'));
const Modals = React.lazy(() => import('./views/notifications/modals/Modals'));
const Colors = React.lazy(() => import('./views/theme/colors/Colors'));
const Typography = React.lazy(() => import('./views/theme/typography/Typography'));
const Widgets = React.lazy(() => import('./views/widgets/Widgets'));
const Users = React.lazy(() => import('./views/users/Users'));
const User = React.lazy(() => import('./views/users/User'));


//Manual Imports
const ProductList = React.lazy(()=>import('./screens/Products/index'));
const CreateProduct = React.lazy(()=>import('./screens/Products/create'));
const EditProduct = React.lazy(()=>import('./screens/Products/edit'));
const PartyList = React.lazy(()=>import('./screens/Party/Index'));
const CreateParty = React.lazy(()=>import('./screens/Party/Create'));
const EditParty = React.lazy(()=>import('./screens/Party/Edit'));
const CustomerList = React.lazy(()=>import('./screens/Customer/Index'));
const CreateCustomer = React.lazy(()=>import('./screens/Customer/Create'));
const CreatePurchaseEntry = React.lazy(()=>import('./screens/Purchase Entry/Purchase/create'));
const PurchaseReport = React.lazy(()=>import('./screens/Reports/PurchaseReport'));
const EditPurchaseEntry = React.lazy(()=>import('./screens/Purchase Entry/Purchase/Edit'));
const EditCustomer = React.lazy(()=>import('./screens/Customer/Edit'));
const SalesReport = React.lazy(()=>import('./screens/Reports/SalesReport'));
const createExpense = React.lazy(()=>import('./screens/Expense/create'))
const editExpense = React.lazy(()=>import('./screens/Expense/Edit'))
const expenseReport = React.lazy(()=>import('./screens/Reports/ExpenseReport'))
const CreateSalesEntry = React.lazy(()=>import('./screens/Sales/Sales Entry/Create'));
const EditSalesEntry = React.lazy(()=>import('./screens/Sales/Sales Entry/Edit'));
const RecieptList = React.lazy(()=>import('./screens/Reciept/index'));
const DetailCustomerReport = React.lazy(()=> import('./screens/Reports/DetailCustomerReport'));
const UserList = React.lazy(()=>import('./screens/Users/Index'));
const CreateUser = React.lazy(()=>import('./screens/Users/Create'));
const EditUser = React.lazy(()=>import('./screens/Users/Edit'));
const WarehouseList = React.lazy(()=>import('./screens/Warehouse/index'));
const CreateWarehouse = React.lazy(()=>import('./screens/Warehouse/create'));
const EditWarehouse = React.lazy(()=>import('./screens/Warehouse/edit'));
const CategoryList = React.lazy(()=>import('./screens/Category/index'));
const CreateCategory = React.lazy(()=>import('./screens/Category/create'));
const EditCategory = React.lazy(()=>import('./screens/Category/edit'));
const EmployeeList = React.lazy(()=>import('./screens/Employee/index'));
const CreateEmployee = React.lazy(()=>import('./screens/Employee/create'));
const EditEmployee = React.lazy(()=>import('./screens/Employee/edit'));
const CompanyList = React.lazy(()=>import('./screens/Companies/index'));
const CreateCompany = React.lazy(()=>import('./screens/Companies/create'));
const EditCompany = React.lazy(()=>import('./screens/Companies/edit'));
const CreatePurchaseReturnEntry = React.lazy(()=>import('./screens/Purchase Entry/Purchase Return/create'));
const PurchaseReturnReport = React.lazy(()=>import('./screens/Reports/PurchaseReturnReport'));
const EditPurchaseReturnEntry = React.lazy(()=>import('./screens/Purchase Entry/Purchase Return/edit'));
const CreateSalesReturnEntry = React.lazy(()=>import('./screens/Sales/Sales Return/create'));
const SalesReturnReport = React.lazy(()=>import('./screens/Reports/SalesReturnReport'));
const EditSalesReturnEntry = React.lazy(()=>import('./screens/Sales/Sales Return/edit'));
const CreateQuotationEntry = React.lazy(()=>import('./screens/Quotation/create'));
const QuotationReport = React.lazy(()=>import('./screens/Reports/QuotationReport'));
const EditQuotationEntry = React.lazy(()=>import('./screens/Quotation/edit'));
const InventoryReport = React.lazy(()=>import('./screens/Reports/InventoryReport'));
const HistoryReport = React.lazy(()=>import('./screens/Reports/HistoryReport'));
const BankList = React.lazy(()=>import('./screens/Bank/index'));
const CreateBank = React.lazy(()=>import('./screens/Bank/create'));
const EditBank = React.lazy(()=>import('./screens/Bank/edit'));
const DetailTransactionReport = React.lazy(()=>import('./screens/Reports/DetailTransactionReport'));

const routes = [
  { path: '/', exact: true, name: 'Home' },
  { path: '/dashboard', name: 'Dashboard', component: Dashboard },
  { path: '/theme', name: 'Theme', component: Colors, exact: true },
  { path: '/theme/colors', name: 'Colors', component: Colors },
  { path: '/theme/typography', name: 'Typography', component: Typography },
  { path: '/base', name: 'Base', component: Cards, exact: true },
  { path: '/base/breadcrumbs', name: 'Breadcrumbs', component: Breadcrumbs },
  { path: '/base/cards', name: 'Cards', component: Cards },
  { path: '/base/carousels', name: 'Carousel', component: Carousels },
  { path: '/base/collapses', name: 'Collapse', component: Collapses },
  { path: '/base/forms', name: 'Forms', component: BasicForms },
  { path: '/base/jumbotrons', name: 'Jumbotrons', component: Jumbotrons },
  { path: '/base/list-groups', name: 'List Groups', component: ListGroups },
  { path: '/base/navbars', name: 'Navbars', component: Navbars },
  { path: '/base/navs', name: 'Navs', component: Navs },
  { path: '/base/paginations', name: 'Paginations', component: Paginations },
  { path: '/base/popovers', name: 'Popovers', component: Popovers },
  { path: '/base/progress-bar', name: 'Progress Bar', component: ProgressBar },
  { path: '/base/switches', name: 'Switches', component: Switches },
  { path: '/base/tables', name: 'Tables', component: Tables },
  { path: '/base/tabs', name: 'Tabs', component: Tabs },
  { path: '/base/tooltips', name: 'Tooltips', component: Tooltips },
  { path: '/buttons', name: 'Buttons', component: Buttons, exact: true },
  { path: '/buttons/buttons', name: 'Buttons', component: Buttons },
  { path: '/buttons/button-dropdowns', name: 'Dropdowns', component: ButtonDropdowns },
  { path: '/buttons/button-groups', name: 'Button Groups', component: ButtonGroups },
  { path: '/buttons/brand-buttons', name: 'Brand Buttons', component: BrandButtons },
  { path: '/charts', name: 'Charts', component: Charts },
  { path: '/icons', exact: true, name: 'Icons', component: CoreUIIcons },
  { path: '/icons/coreui-icons', name: 'CoreUI Icons', component: CoreUIIcons },
  { path: '/icons/flags', name: 'Flags', component: Flags },
  { path: '/icons/brands', name: 'Brands', component: Brands },
  { path: '/notifications', name: 'Notifications', component: Alerts, exact: true },
  { path: '/notifications/alerts', name: 'Alerts', component: Alerts },
  { path: '/notifications/badges', name: 'Badges', component: Badges },
  { path: '/notifications/modals', name: 'Modals', component: Modals },
  { path: '/notifications/toaster', name: 'Toaster', component: Toaster },
  { path: '/widgets', name: 'Widgets', component: Widgets },
  { path: '/users', exact: true,  name: 'Users', component: Users },
  { path: '/users/:id', exact: true, name: 'User Details', component: User },

  //manual routes

  {path : '/productList',exact : true,name : 'Product List',component: ProductList},
  {path : '/create/product',exact : true,name : 'Create Product',component: CreateProduct},
  {path : '/edit/product/:id',exact : true,name : 'Edit Product',component: EditProduct},
  {path : '/partyList',exact : true,name : 'Party List',component:PartyList},
  {path : '/create/party',exact : true,name : 'Create Party',component:CreateParty},
  {path : '/edit/party/:id',exact : true,name : 'Edit Party',component:EditParty},
  {path : '/customerList',exact : true,name : 'Customer List',component:CustomerList},
  {path : '/create/customer',exact : true,name : 'Create Customer',component:CreateCustomer},
  {path : '/create/purchase',exact : true,name : 'Create Purchase Entry',component:CreatePurchaseEntry},
  {path:'/purchaseReport',exact:true,name:'Purchase Report',component:PurchaseReport},
  {path : '/edit/customer/:id',exact : true,name : 'Edit Customer',component:EditCustomer},
  {path : '/edit/purchase/:id',exact : true, name : 'Edit Purchase',component : EditPurchaseEntry},
  {path : '/salesReport',exact : true,name : 'Sales Report',component : SalesReport},
  {path : '/DayWiseProfit',exact : true,name : 'Day Wise Profit Report',component : DayWiseProfit},
  {path : '/create/expense',exact : true,name : 'Create Expense',component : createExpense},
  {path : '/expenseReport',exact : true,name : 'Expense Report',component : expenseReport},
  {path : '/edit/expense/:id',exact : true,name : 'Edit Expense',component : editExpense},
  {path : '/create/sales',exact : true,name : 'Create Sales',component:CreateSalesEntry},
  {path : '/edit/sales/:id',exact : true, name : 'Edit Sales',component : EditSalesEntry},
  {path : '/recieptList',exact : true,name : 'Reciept List',component : RecieptList},
  {path : '/userList',exact : true,name : 'User List',component: UserList},
  {path : '/create/user',exact : true,name : 'Create User',component:CreateUser},
  {path : '/edit/user/:id',exact : true,name : 'Edit User',component:EditUser},
  {path : '/DetailCustomerReport',exact: true, name: 'Customer Detail Report', component: DetailCustomerReport},
  {path : '/warehouseList',exact : true,name : 'Warehouse List',component: WarehouseList},
  {path : '/create/warehouse',exact : true,name : 'Create Warehouse',component: CreateWarehouse},
  {path : '/edit/warehouse/:id',exact : true,name : 'Edit Warehouse',component: EditWarehouse},
  {path : '/categoryList',exact : true,name : 'Category List',component: CategoryList},
  {path : '/create/category',exact : true,name : 'Create Category',component: CreateCategory},
  {path : '/edit/category/:id',exact : true,name : 'Edit Category',component: EditCategory}, 
  {path : '/employeeList',exact : true,name : 'Employee List',component: EmployeeList},
  {path : '/create/employee',exact : true,name : 'Create Employee',component: CreateEmployee},
  {path : '/edit/employee/:id',exact : true,name : 'Edit Employee',component: EditEmployee},
  {path : '/companyList',exact : true,name : 'Company List',component: CompanyList},
  {path : '/create/company',exact : true,name : 'Create Company',component: CreateCompany},
  {path : '/edit/company/:id',exact : true,name : 'Edit Company',component: EditCompany},
  {path : '/create/purchaseReturn',exact : true,name : 'Create Purchase Return Entry',component:CreatePurchaseReturnEntry},
  {path :'/purchaseReturnReport',exact : true,name:'Purchase Return Report',component: PurchaseReturnReport},
  {path : '/edit/purchaseReturn/:id',exact : true, name : 'Edit Purchase Return',component : EditPurchaseReturnEntry},
  {path : '/create/salesReturn',exact : true,name : 'Create Sales Return Entry',component:CreateSalesReturnEntry},
  {path :'/salesReturnReport',exact : true,name:'Sales Return Report',component: SalesReturnReport},
  {path : '/edit/salesReturn/:id',exact : true, name : 'Edit Sales Return',component : EditSalesReturnEntry},
  {path : '/create/quotation',exact : true,name : 'Create Quotation Entry',component:CreateQuotationEntry},
  {path :'/quotationReport',exact : true,name:'Quotation Report',component: QuotationReport},
  {path : '/edit/quotation/:id',exact : true, name : 'Edit Quotation',component : EditQuotationEntry},
  {path : '/inventoryList', exact: true, name:'Inventory List', component: InventoryReport},
  {path : '/historyReport', exact: true, name:'History List', component: HistoryReport},
  {path : '/bankList',exact : true,name : 'Bank List',component: BankList},
  {path : '/create/bank',exact : true, name : 'Create Bank',component: CreateBank},
  {path : '/edit/bank/:id',exact : true, name : 'Edit Bank',component: EditBank},
  {path : '/DetailTransactionReport/:id', exact : true, name : 'Transaction List',component: DetailTransactionReport},
];

export default routes;
